import React, { Fragment, useState } from 'react';
import PropTypes from 'prop-types';
import { IoIosArrowBack } from 'react-icons/io';
import { IoIosArrowForward } from 'react-icons/io';
import Loader from '@hotel/components/Loader/Loader';
import ServiceOrderWrapper,{Title,SubTitle} from './ServiceOrder.style'
  
const ServiceListing = () => {
    return (
        <ServiceOrderWrapper>
           <Title>Thông tin đặt lịch</Title>
           <SubTitle>Dịch vụ</SubTitle>
           <input type="text" id="fname" name="firstname" placeholder="Sơn móng tay"></input>
           <SubTitle>Địa chỉ</SubTitle>
        </ServiceOrderWrapper>
    );
};
export default ServiceListing;
